import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

import {BrowserRouter as Router, Route, Link, NavLink, Redirect, Switch} from 'react-router-dom';

import News from './News';
import Profile from './Profile';
import Error from './Error';

class App extends Component {

  state = {
    loggedIn :false
  }

  OnClickButton= () => {
     this.setState(prevState => ({

      loggedIn: !prevState.loggedIn
     }))
  }

  render() {
    return (


   <Router>
   <div>
   <ul className="navbar">
    <li><NavLink exact to="/">Homepage</NavLink></li>
    <li><NavLink exact to="/contact">Contact</NavLink></li>
    <li><NavLink exact to="/news">News</NavLink></li>
    <li><NavLink exact to="/profile">Profile</NavLink></li>
   </ul>


    <input type="button" onClick= {this.OnClickButton} 
    value={ this.state.loggedIn ? 'Logout' : 'Login' } />
<Switch>
   <Route path="/"  exact render= {() => { return(<h1>Homepage</h1>)}}>
   </Route>
   <Route path="/contact"  exact render= {() => { return(<h1>Contact</h1>)}}>
   </Route>

   <Route path="/news"  exact component= {News}>
   </Route>

   <Route path="/profile"  exact render= {() => ( this.state.loggedIn ? (<Profile/>) : (<Redirect to="/" />) )}>
   </Route>

   <Route component= {Error}>
   </Route>
</Switch>
   </div>
   </Router>


    );
  }
}

export default App;
